Cominciamo con la sintassi e la nomenclatura dei vari componenti di un foglio di stile. Un foglio di stile CSS è formato da un insieme di regole . Ogni regola ha la seguente struttura: Vediamola nel dettaglio. la regola comincia con un selettore , che serve per selezionare su quali elementi verrà applicata la regola la seconda parte della regola è la dichiarazione , racchiusa in parentesi graffe all'interno della dichiarazione c'è una lista di proprietà , separate da punto e virgola ogni proprietà ha un nome ed un valore , separati tra loro dai due punti Vediamo alcuni esempi: /* cambia il colore dello sfondo di tutta la pagina */
body { background-color: blue;
} /* cambia il colore del testo di tutti i paragrafi */
p { color: red;
} Di seguito dettagliamo alcune caratteristiche importanti del CSS.

