Un altro concetto fondamentale del CSS è che un elemento può essere di uno di questi due tipi: inline : si adatta al contenuto block : si adatta al contenitore Alcuni elementi sono nativamente inline, ed altri nativamente block. Ad esempio, i paragrafi sono block e gli span sono inline: <style> p { background-color: red; } span { background-color: blue; }
</style> <p><span>ciao</span></p> Questo è il risultato: Quando nella scrittura della pagina mi servono alcuni elementi inline o block per agganciarli al CSS ma senza un particolare valore semantico, posso usare i seguenti tag: <span> come generico elemento inline <div> come generico elemento block In ogni caso, è sempre possibile cambiare il comportamento di default di un elemento attraverso la proprietà CSS "display": /* la seguente regola trasforma i paragrafi in elementi inline */
p { display: inline;
} Nota: esiste anche un valore ibrido inline-block, utile in alcune situazioni, per maggiori informazioni vedete qui

