Per impostare i valori del box model esistono le seguenti proprietà CSS: padding: per impostare il padding border: per impostare il bordo margin: per impostare il margine Esempi
Nel seguente esempio imposto i valori in tutte e quattro le direzioni intorno all'elemento selezionato. p { padding: 5px; border: 0px; margin: 5px; } Di solito voglio però controllare in modo più fine il valore in una specifica direzione, ad esempio solo in alto, o solo a sinistra. Per fare questo, ognuna di queste proprietà ha a sua volta quattro sotto proprietà: -top: sopra l'elemento -right: a sinistra dell'elemento -bottom: a destra dell'elemento -left: a sinistra dell'elemento Esempi
Nel seguente esempio imposto i valori solo nelle direzioni scelte. p { padding-left: 5px; border-top: 0px; border-bottom: 0px; margin-right: 5px;
} Se voglio impostare tutti e quattro i valori per una data proprietà in un colpo solo, esiste una versione abbreviata, in cui specifico tutti i valori nella stessa linea. Mi devo ricordare che i valori sono messi come i numeri di un orologio analogico: parto dall'alto e giro in senso orario, quindi nell'ordine sono top, right, bottom, left. Esempi
Nel seguente esempio imposto tutti e quattro i valori in una sola linea. p { background-color: red; padding: 0px 15px 30px 50px;
} Il risultato: ciao

