Per selezionare tutti gli elementi della pagina, esiste il selettore universale (universal selector), che si rappresenta con l'asterisco * (star, in inglese). # Cambia il font di tutti gli elementi della pagina in Times New Roman.
* { font-style: font-family: "Times New Roman", Times, serif;
}

47.body:
I selettori hanno ognuno una propria specificità. Di seguito sono elencati dalla specificità più bassa alla più alta: Tag (es. h1) Classi (es. .btn-green) ID (es. #avatar) In altre parole, come intuibile, le regole selezionate con l'ID avranno la precedenza sulle altre, seguite da quelle selezionate con le classi e poi dai generici tag. Il selettore universale ha specificità nulla (più bassa di tutte). Ad esempio, ipotizziamo di avere il seguente paragrafo: <p id="esempio" class="esempio">Ciao</p> con il seguente CSS: #esempio { background-color: red;
} p { background-color: blue;
} .esempio { background-color: green;
} Quale colore assumerà il paragrafo? La regola con l'ID ha la specificità più alta e verrà quindi applicata: Ciao #true-html>p { background-color: blue; } In caso di selettori combinati fra loro, esiste una formula per calcolare la specificità, si rimanda qui per maggiori dettagli. Per vedere tutte le regole applicate ad un certo elemento potete usare i devTools di Chrome o Firefox; trovate le regole nel tab "style". Per indagare possibili conflitti tra regole, c'è questa guida ufficiale di Chrome.

