In molti casi può essere utile avere delle dimensioni che si adattano alla grandezza del testo; in questo caso si usa rem: /* La dimensione del testo di questo paragrafo è il doppio rispetto a quella base. */
p.big { font-size: 2rem;
} Le dimensioni relative al testo sono molto utili anche perché scalano automaticamente quando si ingrandisce o rimpicciolisce il testo della pagina.
